export default function App(){

const [me,Sayyesno]=React.useState("Yes");


function Togel(){
    Sayyesno((prev)=>(prev === "Yes"? "NO": "Yes"))
}

return(<div style={{fontSize:"50px",textAlign:"center"}} onClick={Togel}>{me}</div>)

}
